import React from "react";
function ButtonUse() {
  return (
    <div>
      <input
        placeholder="https://linkedin.com"
        type="url"
        id="linkedinUrl"
        classname="inputs"
      ></input>
      <button type="submit">Start</button>
    </div>
  );
}

export default ButtonUse;
